import React from 'react'
import Sticker from '../../components/Main/Auction/Sticker'
function Auctions(){

  let stickList = []
    for(let i = 0; i < 9; i++){
      stickList.push(<li><Sticker index={'stick' + {i}}/></li>)
    }
    return(

      <ul>{stickList}</ul>

      )
  }


export default Auctions
